import React from 'react';
import { View, Text, Image} from 'react-native';

import styles from './styles';

const Header = (props: any) => {

    return (
        <View style={styles.container}>
            <Image 
                style={styles.logo}
                source={require("../../assets/images/logo.png")}
            />
            <Text>
                Header
            </Text>
        </View>
    );

}

export default Header;
